import React from "react";
import "./App.css";
import {DishData} from './data'

export const Dishes = () => {
  return (
    <div className="stock-container">
        {DishData.map((data, key) => {
          return (
            <div key={key}>
              {data.company +
                " , " +
                data.ticker +
                " ," +
                data.stockPrice +
                ", " +
                data.timeElapsed}
            </div>
          );
        })}

    </div>
  );
};
